INSERT INTO `produit` (`id`, `identifiant`, `nom`, `description`, `categorie`, `prix`, `id_tva`, `stock`, `image`, `poids`, `date_creation`, `statut`) VALUES
(2, 'TruffeChocolat', 'truffe au chocolat', 'Succombez à la tentation avec nos truffes au chocolat, confectionnées à la main avec les meilleurs ingrédients. Chaque bouchée est une explosion de saveurs, avec un cœur fondant de chocolat noir intense enrobé d\'une fine couche de cacao en poudre. Nos truffes sont fabriquées en petite quantité pour garantir une fraîcheur et une qualité exceptionnelle. Vous souhaitez un trouver un cadeau ou simplement déguster des gourmandises au chocolat de qualité, nos truffes sont l\'option parfaite. Commandez dès maintenant sur Chocolito et découvrez les saveurs d’un chocolat de qualité pour votre plus grand plaisir. ', 'truffe', 10.99, 1, 58, 'https://media.discordapp.net/attachments/982016047911694416/1075331178623672320/iu.png?width=785&height=468', 250, '2023-01-30 14:59:07', 1),
(3, 'ChocolatBlanc', 'Chocolat blanc', 'Découvrez notre délicieuse tablette de chocolat blanc, faite avec les meilleurs ingrédients pour une expérience gustative exceptionnelle. Notre chocolat blanc est crémeux et fondant en bouche, avec une douce saveur de vanille. Nous utilisons uniquement du beurre de cacao pur et de la vraie vanille pour une qualité supérieure. Chaque carré de chocolat est une invitation à un moment de plaisir et de détente. Nos tablettes de chocolat blanc sont emballées avec soin pour garantir leur fraîcheur et leur saveur. Vous souhaitez un trouver un cadeau ou simplement déguster des gourmandises au chocolat de qualité, notre chocolat blanc est l\'option parfaite. Commandez dès maintenant sur Chocolito et découvrez les saveurs d’un chocolat de qualité pour votre plus grand plaisir.', 'tablette', 5, 1, 50, 'https://media.discordapp.net/attachments/982016047911694416/1075333711429652510/i179714-shutterstock-1175481289.png', 150, '2023-02-15 21:40:31', 1),
(4, 'tabletteChocoCara', 'Tablette chocolat noir fourrée au caramel fondant ', 'Laissez-vous tenter par notre irrésistible tablette de chocolat noir fourrée au caramel fondant, une combinaison parfaite de douceur et d\'intensité. Notre chocolat noir est riche et corsé. Le caramel fondant à l\'intérieur est préparé avec du sucre pur et du beurre frais pour une texture onctueuse et un goût délicieux. Chaque carré de chocolat est une expérience gustative unique, avec une explosion de saveurs en bouche. Nos tablettes de chocolat noir fourrées au caramel fondant sont emballées individuellement pour garantir leur fraîcheur et leur saveur. Vous souhaitez un trouver un cadeau ou simplement déguster des gourmandises au chocolat de qualité, nos tablettes de chocolat noir fourrée au caramel fondant sont l\'option parfaite. Commandez dès maintenant sur Chocolito et découvrez les saveurs d’un chocolat de qualité pour votre plus grand plaisir.', 'tbalette', 8, 1, 50, 'https://media.discordapp.net/attachments/982016047911694416/1076434763990179901/deae9e53cde95be36a0698b5a045b81a.png', 150, '2023-02-18 09:30:46', 1),
(5, 'tabletteChocoRiz', 'Tablette chocolat au riz soufflé ', 'Découvrez notre tablette de chocolat au lait croustillante au riz soufflé, une expérience gustative unique alliant douceur et croquant. Notre chocolat au lait de qualité supérieure est onctueux et fondant en bouche, offrant des notes de cacao intenses et une légère pointe de lait frais. Le riz soufflé croustillant ajoute une texture croquante et une saveur délicieusement grillée, pour une expérience de dégustation inoubliable. Chaque carré de chocolat est une invitation à un moment de plaisir et de détente. Nos tablettes de chocolat au riz soufflé sont emballées avec soin pour garantir leur fraîcheur et leur saveur. Pour un cadeau gourmand ou simplement pour vous faire plaisir, commandez dès maintenant sur Chocolito et savourez la différence d\'un chocolat de qualité artisanale.\r\n\r\n\r\n', 'tablette', 8, 1, 50, 'https://media.discordapp.net/attachments/982016047911694416/1076433608451051520/66d17d83190df28a6ad3b20db17cb7d8.png?width=928&height=468', 150, '2023-02-18 09:31:47', 1),
(7, 'mendiantsChoco', 'Mendiants au chocolat noir', 'Découvrez nos mendiants au chocolat, de délicieuses bouchées de chocolat noir à croquer. Notre chocolat noir de qualité supérieure est intensément riche en cacao, offrant une saveur corsée et profonde. Les mendiants sont agrémentés d\'une variété de fruits secs et de noix, ajoutant des textures croquantes et des saveurs délicates à chaque bouchée. Les fruits secs et les noix sont soigneusement sélectionnés pour leur qualité supérieure, pour offrir une expérience gustative inoubliable. Vous souhaitez offrir un cadeau gourmand ou tout simplement vous faire plaisir, nos mendiants au chocolat sont l\'option parfaite. Commandez dès maintenant sur Chocolito et dégustez les meilleures bouchées de chocolat noir avec une touche de fruit et de noix pour une expérience de dégustation incomparable.', 'friandises', 7, 1, 15, 'https://media.discordapp.net/attachments/982016047911694416/1076531117953392731/IMG_8256-3.png?width=702&height=468', 50, '2023-02-18 15:50:32', 1),
(8, 'orangette', 'Orangette chocolat noir', 'Découvrez nos orangettes, de délicieuses friandises au chocolat noir mariant l\'acidité de l\'orange confite à la douceur du chocolat noir. Nos orangettes sont préparées à partir d\'ingrédients de qualité supérieure, des oranges confites soigneusement sélectionnées et du chocolat noir pur beurre de cacao, offrant une expérience gustative inoubliable. Chaque bouchée de chocolat noir fondant renferme une fine tranche d\'orange confite, ajoutant une touche d\'acidité et de fraîcheur à chaque dégustation. Nos orangettes sont présentées dans un élégant emballage, parfait pour offrir en cadeau ou pour s\'offrir un petit plaisir. Vous souhaitez trouver un cadeau gourmand ou simplement vous faire plaisir, nos orangettes sont une option idéale. Commandez dès maintenant sur Chocolito et découvrez les saveurs d\'un chocolat noir de qualité avec une touche d\'orange confite pour une expérience gustative exceptionnelle.', 'friandise', 9, 1, 20, 'https://media.discordapp.net/attachments/982016047911694416/1076532406720409690/orangettes-1000x500.png?width=936&height=468', 200, '2023-02-18 15:56:24', 1);
